--------------------------------------------------------
--  DDL for Procedure INSERT_MURACAAT
--------------------------------------------------------
set define off;

  CREATE OR REPLACE EDITIONABLE PROCEDURE "GEBZEADMIN"."INSERT_MURACAAT" (
    p_kimlik_no IN NUMBER,
    p_isim IN VARCHAR2,
    p_soyisim IN VARCHAR2,
    p_cinsiyet IN CHAR,
    p_medeni_durum_id IN NUMBER,
    p_cilt_no IN NUMBER,
    p_aile_sira_no IN NUMBER,
    p_sira_no IN NUMBER,
    p_dogum_tarihi IN DATE,
    p_kisi_adres_mahalle_id IN NUMBER,
    p_kisi_mahalle_sokak_id IN NUMBER,
    p_site IN VARCHAR2,
    p_tarif IN VARCHAR2,
    p_kapi_no IN VARCHAR2,
    p_daire_no IN VARCHAR2,
    p_ev_telefon IN VARCHAR2,
    p_cep_telefon IN VARCHAR2,
    p_eposta IN VARCHAR2,
    p_kayit_tarihi IN DATE,
    p_aktif IN NUMBER,
    p_muracaat_id OUT NUMBER
) AS
    v_kisi_id NUMBER;
    v_kisi_temel_id NUMBER;
    v_kisi_iletisim_id NUMBER;
    v_kisi_detay_id NUMBER;
    v_kisi_adres_id NUMBER;
    v_kisi_egitim_id NUMBER;
    v_muracaat_bilgi_id NUMBER;
BEGIN
    -- KISI_TEMEL tablosuna veri ekleme
    INSERT INTO KISI_TEMEL (KISI_ID, KIMLIK_NO, ISIM, SOYISIM, CINSIYET, CILT_NO, AILE_SIRA_NO, SIRA_NO, MEDENI_DURUM_ID, DOGUM_TARIHI, AKTIF,KISI_DETAY_ID)
    VALUES (v_kisi_id,p_kimlik_no, p_isim, p_soyisim, p_cinsiyet, p_cilt_no, p_aile_sira_no, p_sira_no, p_medeni_durum_id, p_dogum_tarihi, p_aktif,v_kisi_temel_id)
    RETURNING KISI_ID INTO v_kisi_temel_id;

    -- KISI_ILETISIM tablosuna veri ekleme
    INSERT INTO KISI_ILETISIM (KISI_ILETISIM_ID,CEP_TELEFON, EV_TELEFON, EPOSTA, KAYIT_TARIHI, AKTIF)
    VALUES (v_kisi_temel_id,p_cep_telefon, p_ev_telefon, p_eposta, SYSTIMESTAMP, p_aktif)
    RETURNING KISI_ILETISIM_ID INTO v_kisi_iletisim_id;

    -- KISI_ADRES tablosuna veri ekleme (KISI_ADRES_ID otomatik oluþturuluyorsa manuel atama yapýlmaz)
    INSERT INTO KISI_ADRES (TARIF, SITE, KAPI_NO, DAIRE_NO, KISI_ADRES_MAHALLE_ID, KISI_MAHALLE_SOKAK_ID)
    VALUES (p_tarif, p_site, p_kapi_no, p_daire_no, p_kisi_adres_mahalle_id, p_kisi_mahalle_sokak_id)
    RETURNING KISI_ADRES_ID INTO v_kisi_adres_id;
    
    INSERT INTO KISI_EGITIM_DURUM (egýtým_durum_ýd)
    VALUES (v_kisi_temel_id)
    RETURNING egýtým_durum_ýd INTO v_kisi_egitim_id;

    -- KISI_DETAY tablosuna veri ekleme (Doðru KISI_ID ve diðer sütunlarla)
    INSERT INTO KISI_DETAY (DETAY_ID,KISI_ID, KISI_ILETISIM_ID, KISI_ADRES_ID, KISI_EGITIM_ID, GUNCELLEME_TARIHI)
    VALUES (v_kisi_temel_id,v_kisi_temel_id, v_kisi_iletisim_id, v_kisi_adres_id, v_kisi_egitim_id, SYSTIMESTAMP)
    RETURNING DETAY_ID INTO v_kisi_detay_id;
    
    INSERT INTO MURACAAT_BILGI (MURACAAT_BILGI_ID)
    VALUES(v_kisi_temel_id)
    RETURNING muracaat_býlgý_ýd INTO v_muracaat_bilgi_id;

    -- MURACAAT tablosuna veri ekleme
    INSERT INTO MURACAAT (KISI_TEMEL_ID,MURACAAT_BILGI_ID, KAYIT_TARIHI, AKTIF)
    VALUES (v_kisi_temel_id,v_muracaat_bilgi_id, SYSTIMESTAMP, p_aktif)
    RETURNING MURACAAT_ID INTO p_muracaat_id;

    COMMIT;
END;

