    p_TUTANAK_INCELEME IN INCELEME_BEYAN.TUTANAK_INCELEME%TYPE
) AS
    v_beyani_id BASVURU_BEYAN.BASVURU_BEYAN_ID%TYPE;
    v_inceleme_id INCELEME_BEYAN.INCELEME_BEYAN_ID%TYPE;
BEGIN
