    INSERT INTO INCELEME_BEYAN (INCELEME_BEYAN_ID, TUTANAK_INCELEME)
    VALUES (v_beyani_id, p_TUTANAK_INCELEME);

    -- (Eðer baþka bir iþlem gerekiyorsa buraya eklenebilir)

    COMMIT;
EXCEPTION
    WHEN OTHERS THEN
        ROLLBACK;
        RAISE;
END;

